import React, { useState } from "react";
import AddIcon from '@material-ui/icons/Add';
import RemoveIcon from '@material-ui/icons/Remove';

const App = () =>{

    const [num, setNum] = useState("0");

    const incNum = () =>{

        return etNum(num + 1);

    };

    const decNum = () =>{

        return setNum(num - 1);

    };


    return(
        <>

        <div className="main_box">
            <div className="card_box">

                <h1>{num}</h1>
                <div style={{ float : "left"}}><button onClick={incNum}>  <AddIcon/>  </button></div>
                <div style={{ float : "right"}}><button onClick={decNum}>  <RemoveIcon/>  </button></div>

            </div>
        </div>

        </>
    );
};
export default App;
